In C programming, there are three types of variables: local variables, static variables, and global variables.

1. Local Variables:
Local variables are declared within a function or a block of code. They are created when the function or block is executed and destroyed when the function or block is exited. Local variables are not accessible outside of their defining function or block.

2. Static Variables:
Static variables are similar to local variables, but they are not destroyed when the function or block is exited. Instead, they retain their value between function calls. If a static variable is declared inside a function, it is initialized only once, the first time the function is called. If a static variable is declared outside a function, it is initialized only once, when the program starts.

3. Global Variables:
Global variables are declared outside any function or block. They are accessible from any part of the program. Global variables are created when the program starts and destroyed when the program ends.

In terms of storage, local variables are stored on the stack, while static variables are stored in the data segment of the program's memory. Global variables can be stored in either the data segment or the bss segment, depending on whether they are initialized or not. Register variables are a special type of variable that are stored in the CPU's registers instead of memory. They are used for high-performance computing, but they are not commonly used in C programming.

