Example 1: Inconsistent file structure for translations

In a library or book order platform, we might have different files for translations in different languages. However, if these files are not structured consistently, it can lead to i18n violations.

Incorrect:

```
// en.json
{
  "welcome": "Welcome to our library!",
  "search": "Search",
  "cart": "Cart"
}

// fr.json
{
  "welcome": "Bienvenue dans notre bibliothèque!",
  "search": "Rechercher",
  "cart": "Panier"
}
```

In this example, the keys for the translations are the same, but the values are in different languages. This is not a consistent file structure, as the keys should be the same across all files for the same translation.

Correct:

```
// en.json
{
  "welcome": "Welcome",
  "search": "Search",
  "cart": "Cart"
}

// fr.json
{
  "welcome": "Bienvenue",
  "search": "Rechercher",
  "cart": "Panier"
}
```

In this corrected example, the keys for the translations are the same across all files, ensuring a consistent file structure.

